import './App.css';
import React, { useState, useEffect } from 'react';
import {Button, Navbar} from './components/common';
import {BrowserRouter as Router} from 'react-router-dom';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
import { library } from '@fortawesome/fontawesome-svg-core';
import { faUpload, faPen } from '@fortawesome/free-solid-svg-icons';
library.add(faUpload, faPen)

function App() {
  return (  
    <Router>
      <Navbar/>
      <div className="buttons">
      <Button /*onClick={()=> {console.log("hello world")}}*/
      type="button"
      buttonStyle="btn--primary--solid"
      buttonSize="btn--large">
        <FontAwesomeIcon icon="upload"/>
        <p className="b11">Upload file </p>
        <p className="b1">Upload your blank pdf files here!</p>
      </Button>
      <Button
      type="button"
      buttonStyle="btn--primary--solid"
      buttonSize="btn--large">
        <FontAwesomeIcon icon="upload"/>
        <p className="b12">Upload Master Document</p>
        <p className="b1">Upload your master document here!</p>

      </Button>
      <Button
      type="button"
      buttonStyle="btn--primary--solid"
      buttonSize="btn--large">
        <FontAwesomeIcon icon="pen"/>
        <p className="b11">Create Master Document</p>
        <p className="b1">Create your master document here!</p>
        

      </Button>
  </div>
  
    </Router>
  );
}

export default App;
